import React from "react";


import groceries from './images/main/groceries.png'
console.log(groceries)

function Main() {
  return (
    <div className="container">

      <main className='container vertical-centre border'>
          <div className='row top2 centre'>
              <h1>Estia</h1>
          </div>

          <div className='row top1'>
              <button className='col centre border'>

                  <img src={groceries} alt='groceries'></img>

              </button>
              {/* <div className='col-1 border centre vertical-centre fas fa-bell'></div>               */}
          </div>


          <div className='row top1'>
              <button className='col centre border'>Cleaning products</button>
              <div className='col-1 border centre vertical-centre fas fa-bell'></div>              
          </div>



          <div className='row top1'>
              <button className='col centre border fas fa-shopping-basket'></button>
              <div className='col-1 border centre vertical-centre fas fa-bell'></div>              
          </div>






      </main>




    </div>
  );
}

export default Main;
